INSERT INTO `t_question` VALUES ('2', '1', '<p>驾驶机动车在道路上违反交通道路安全法，属于什么行为？<br></p>', '1', '[{\"key\":\"A\",\"value\":\"违章行为\"},{\"key\":\"B\",\"value\":\"违法行为\"},{\"key\":\"C\",\"value\":\"过失行为\"},{\"key\":\"D\",\"value\":\"违规行为\"}]', 'B', '1', '驾驶机动车在道路上违反交通道路安全法，属于违法行为。', '道路交通安全法律、法规', '交通道路安全法');
INSERT INTO `t_question` VALUES ('3', '1', '林某驾车以110公里/小时的速度在城市道路上行驶，与一辆机动车追尾后弃车逃离被群众拦下。经鉴定，事发时林某血液中的酒精浓度是135.8毫克/百毫升。林某的主要违法行为是什么？', '2', '[{\"key\":\"A\",\"value\":\"醉酒驾驶\"},{\"key\":\"B\",\"value\":\"超速驾驶\"},{\"key\":\"C\",\"value\":\"疲劳驾驶\"},{\"key\":\"D\",\"value\":\"肇事逃逸\"}]', 'A,B,D', '2', '林某驾车以110公里/小时的速度在城市道路上行驶，与一辆机动车追尾后弃车逃离被群众拦下。经鉴定，事发时林某血液中的酒精浓度是135.8毫克/百毫升。林某的主要违法行为是醉酒驾驶、超速驾驶、肇事逃逸。', '道路交通安全法律、法规', '肇事逃逸,超速驾驶');
INSERT INTO `t_question` VALUES ('5', '1', '<p>机动车驾驶人违法家是造成交通事故构成犯罪的，依法追究什么责任？<br></p>', '1', '[{\"key\":\"A\",\"value\":\"刑事责任\"},{\"key\":\"B\",\"value\":\"民事责任\"},{\"key\":\"C\",\"value\":\"经济责任\"},{\"key\":\"D\",\"value\":\"直接责任\"}]', 'A', '1', '机动车驾驶人违法家是造成交通事故构成犯罪的，依法追究刑事责任。', '道路交通安全法律、法规', '构成犯罪,刑事责任');
INSERT INTO `t_question` VALUES ('6', '1', '<p>机动车驾驶人造成交通事故后逃逸构成犯罪的，吊销驾驶证且多长时间不得重新取得驾驶证？ <br></p>', '1', '[{\"key\":\"A\",\"value\":\"5年内\"},{\"key\":\"B\",\"value\":\"10年内\"},{\"key\":\"C\",\"value\":\"终生\"},{\"key\":\"D\",\"value\":\"20年内\"}]', 'C', '1', '机动车驾驶人造成交通事故后逃逸构成犯罪的，吊销驾驶证且终生不得重新取得驾驶证', '道路交通安全法律、法规', '犯罪');
INSERT INTO `t_question` VALUES ('12', '1', '<p>驾驶机动车违反交通道理安全法律、法规发生交通事故属于交通违章行为。</p>', '1', '[{\"key\":\"A\",\"value\":\"正确\"},{\"key\":\"B\",\"value\":\"错误\"}]', 'B', '2', '驾驶机动车违反交通道理安全法律、法规发生交通事故属于交通违法行为。', '道路交通安全法律、法规', '事故,违反...法律');
INSERT INTO `t_question` VALUES ('13', '1', '<p>驾驶机动车在路口直行遇到这种信号灯应该怎样行驶？</p><img style=\"width: 398.5px;\" src=\"data:image/jpeg;base64,\" data-filename=\"IMG_20140902_124309.jpg\"><p><br></p><p><br></p>', '1', '[{\"key\":\"A\",\"value\":\"不得越过停止线\"},{\"key\":\"B\",\"value\":\"加速执行通过\"},{\"key\":\"C\",\"value\":\"左转弯行驶\"},{\"key\":\"D\",\"value\":\"进入路口等待\"}]', 'A', '2', '不得越过停止线', '道路交通信号及含义', '路口');
INSERT INTO `t_question` VALUES ('15', '1', '驾驶机动车应当随身携带那种证件？', '1', '[{\"key\":\"A\",\"value\":\"工作证\"},{\"key\":\"B\",\"value\":\"驾驶证\"},{\"key\":\"C\",\"value\":\"身份证\"},{\"key\":\"D\",\"value\":\"职业资格证\"}]', 'B', '1', '驾驶机动车应当随身携带驾驶证', '道路交通安全法律、法规', '驾驶证');
INSERT INTO `t_question` VALUES ('16', '4', '<p>林某驾车以110公里/小时的速度在城市道路行驶，与一辆机动车追尾后弃车逃离被群众拦下。经鉴定，事发时林某血液中酒精浓度为135.9毫克/百毫升。林某的主要违法行为是什么？<br></p>', '2', '[{\"key\":\"A\",\"value\":\"醉酒驾驶\"},{\"key\":\"B\",\"value\":\"超速驾驶\"},{\"key\":\"C\",\"value\":\"疲劳驾驶\"},{\"key\":\"D\",\"value\":\"肇事驾驶\"}]', 'A,B,D', '3', '林某驾车以110公里/小时的速度在城市道路行驶，与一辆机动车追尾后弃车逃离被群众拦下。经鉴定，事发时林某血液中酒精浓度为135.9毫克/百毫升。林某的主要违法行为是醉酒驾驶、超速驾驶、肇事驾驶。', '违法行为综合判断与案例分析', '肇事驾驶,醉酒,超速');
INSERT INTO `t_question` VALUES ('17', '4', '<p>周某夜间驾驶大货车在没有路灯的城市道路上以90公里/小时的速度行驶，一直开启远光灯，在通过一窄路时，因加速抢道，导致对面驶来的一辆小车车撞上右侧护栏。周某的主要违法行为是什么？<br></p>', '2', '[{\"key\":\"A\",\"value\":\"超速驾驶\"},{\"key\":\"B\",\"value\":\"不按规定会车\"},{\"key\":\"C\",\"value\":\"疲劳驾驶\"},{\"key\":\"D\",\"value\":\"不按规定使用灯光\"}]', 'A,B,D', '1', '周某的主要违法行为是超速驾驶、不按规定会车、不按规定使用灯光。', '违法行为综合判断与案例分析', '超速,不按规定会车,不按规定使用灯光');
