INSERT INTO `t_trafficcontent` VALUES ('1', '27', '<ol start=\"1\" type=\"1\"><li class=\"MsoNormal\" style=\"mso-list:l0 level1 lfo1;tab-stops:list 36.0pt\"><font style=\"font-size: 12px;\"><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\n     minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;\n     mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">申领办理机动车驾驶证业务的人，应如实向当地车辆管理所提交规定的材料，如实申报规定的事项，并对其申请材料实质内容的真实性负责。</span><span lang=\"EN-US\"></span></font></li><li class=\"MsoNormal\" style=\"mso-list:l0 level1 lfo1;tab-stops:list 36.0pt\"><font style=\"font-size: 12px;\"><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\n     minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;\n     mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">机动车驾驶人准予佳士得车型顺序一次分为：大型客车（</span><span lang=\"EN-US\">A</span><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;\n     mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:\n     minor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">）、牵引车（</span><span lang=\"EN-US\">A2</span><span style=\"font-family:宋体;mso-ascii-font-family:\n     Calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;\n     mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:Calibri;\n     mso-hansi-theme-font:minor-latin\">）、城市公交车（</span><span lang=\"EN-US\">A3</span><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\n     minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;\n     mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">）、中型客车（</span><span lang=\"EN-US\">B1</span><span style=\"font-family:宋体;mso-ascii-font-family:\n     Calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;\n     mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:Calibri;\n     mso-hansi-theme-font:minor-latin\">）、大型货车（</span><span lang=\"EN-US\">B2</span><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\n     minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;\n     mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">）、小型汽车（</span><span lang=\"EN-US\">C1</span><span style=\"font-family:宋体;mso-ascii-font-family:\n     Calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;\n     mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:Calibri;\n     mso-hansi-theme-font:minor-latin\">）、小型自动挡汽车（</span><span lang=\"EN-US\">C2</span><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\n     minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;\n     mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">）、低速载货汽车（</span><span lang=\"EN-US\">C3</span><span style=\"font-family:宋体;mso-ascii-font-family:\n     Calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;\n     mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:Calibri;\n     mso-hansi-theme-font:minor-latin\">）、三轮汽车（</span><span lang=\"EN-US\">C4</span><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\n     minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;\n     mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">）、残疾人专用小型自动挡载客汽车（</span><span lang=\"EN-US\">C5</span><span style=\"font-family:宋体;mso-ascii-font-family:\n     Calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;\n     mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:Calibri;\n     mso-hansi-theme-font:minor-latin\">）、普通三轮摩托车（</span><span lang=\"EN-US\">D</span><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\n     minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:minor-fareast;\n     mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">）、普通二轮摩托车（</span><span lang=\"EN-US\">E</span><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;\n     mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:\n     minor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">）、前边摩托车（</span><span lang=\"EN-US\">F</span><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;\n     mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:\n     minor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">）、轮式自行机械车（</span><span lang=\"EN-US\">M</span><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;\n     mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:\n     minor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">）、无轨电车（</span><span lang=\"EN-US\">N</span><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;\n     mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:\n     minor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">）和有轨电车（</span><span lang=\"EN-US\">P</span><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;\n     mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:\n     minor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">）。</span></font></li><li class=\"MsoNormal\" style=\"mso-list:l0 level1 lfo1;tab-stops:list 36.0pt\"><font style=\"font-size: 12px;\"><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;\n     mso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:\n     minor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">机动车驾驶证记载和签注以下内容：</span></font></li></ol><img style=\"width: 203px;\" src=\"data:image/jpeg;base64,\" data-filename=\"艺.JPG\"><p><br></p>');
INSERT INTO `t_trafficcontent` VALUES ('7', '33', '<ol><li>机动车驾驶人在机动车驾驶证的6年有效期内，每个记分周期均未记满12分的，换发10年有效期的机动车驾驶证；在机动车驾驶证的10年有效期内，每个记分周期均未记满12分的，换发长期有效的机动车驾驶证。</li><li>机动车驾驶人应当于机动车驾驶证有效期满90日内，向机动车驾驶核发地车辆管理所申请换证。申请时应当填写申请表，并提交以下证明、凭证：（1）机动车驾驶人的身份证明；（2）机动车驾驶证；（3）县级或者部队团级以上医疗机构出具的有关身体条件证明。属于申请残疾人专用小型自动挡载客汽车的，应当提交经省级卫生主管部门制定的专门医疗机构出具的有关身体条件的证明。</li></ol>');
